import styled from 'styled-components';

export const PurposeImg = styled.div`
  /* background-color: red; */
  text-align: center;
  font-size: 14pt;
  height: 250px;
  overflow: hidden;
  img {
    width: 250px;
  }
`;

export const AllPurposeImgs = styled.div`
  display: flex;
  justify-content: space-around;
`
